member.value:
A Rock.Model.SpecialRole enum indicating the special role that this Auth entity applies to.
If this Auth entity does not apply to any special role then the value will be SpecialRole.None or (0); 
If this Auth entity applies to All Users (authenticated and unauthenticated) then the value will be SpecialRole.AllUsers or 1;
If this Auth entity applies to All Authenticated Users then the value will be SpecialRole.AllAuthenticatedUsers or 2;
If this Auth entity applies to All Un-authenticated Users then this value will be SpecialRole.AllUnAuthenticatedUsers or 3.

A Rock.Model.CommunicationRecipientStatus Enum representing the status of Rock.Model.Communication submission to the recipient.
This property will be  CommunicationRecipientStatus.Pending when Rock is waiting to send the Rock.Model.Communication to the recipient;
CommunicationRecipientStatus.Success when Rock has successfully sent the Rock.Model.Communication to the recipient;
CommunicationRecipientStatus.Failed when the attempt to send the Rock.Model.Communication failed.
CommunicationRecipientStatus.Cancelled when the attempt to send the Rock.Model.Communication was canceled.

member.summary:
The status of the scheduled transactions provided by the payment gateway (i.e. Active, Cancelled, etc).
If the gateway doesn't have a status field, this will be null;
The payment gateway component maps this based on the Rock.Model.FinancialScheduledTransaction.StatusMessage.
